import React,{useState} from "react";
import {View,Text,Image,TouchableOpacity,TextInput,TouchableWithoutFeedback,Keyboard} from "react-native";
import styles from "./styles.js";

const images = [
	{name:"Lionel Messi",url:"data:image/jpeg;base64,"},
	{name:"Cristiano Ronaldo",url:"data:image/jpeg;base64,"},
	{name:"Zlatan Ibrahimoviç",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/0/09/Zlatan_Ibrahimovi%C4%87_June_2018.jpg/200px-Zlatan_Ibrahimovi%C4%87_June_2018.jpg"},
	{name:"Luis Suarez",url:"data:image/jpeg;base64,"}
];

const split = (str) => {
	let words = [];
	let h = 0;
	for(let i=0;i<str.length;i++){
		if(str[i]===" "){
			words.push(str.substring(h,i));
			h=i+1;
		}
		else if(i===str.length-1){
			words.push(str.substring(h));
			break;
		}
	}
	return words;
}

const contains = (str1,str2) => {
	return str1.toLowerCase()===str2.toLowerCase() || str1.toLowerCase()===split(str2)[split(str2).length-1].toLowerCase();
}

const textStyle = (mycolor) => {return {fontSize:20,color:mycolor}}

const App = () => {
	const [count,setCount] = useState(0);
	const [blur,setBlur] = useState(5);
	const [mycolor,setMycolor] = useState("");
	const [guess,setGuess] = useState("");
	const [verify,setVerify] = useState("");
	const [check,setCheck] = useState(true);

	return(
		<TouchableWithoutFeedback onPress={()=>Keyboard.dismiss()}>
			<View style={styles.container}>
				<TextInput placeholder="Guess Player" style={styles.input} value={guess}
				onChangeText={e=>{
					setGuess(e);
				}}/>
				<TouchableOpacity onPress={() =>{
					if(check){
						if(guess.length===0){
							setVerify("Empty Input !");
							setMycolor("red");
							return;
						}
						else if(contains(guess,images[count].name)){
							setBlur(0);
							setVerify("Correct ! Well Done !");
							setMycolor("green");
							setCheck(false);
							return;
						}
						else{
							setBlur(0);
							setMycolor("red");
							setVerify(`Wrong ! That's ${images[count].name} !`);
							setCheck(false);
							return;
						}
					}
					else{
						setVerify("");
						setGuess("");
						setBlur(5);
						setMycolor("");
						setCount(count+1);
						setCheck(true);
						if(count===images.length-1){
							setCount(0);
						}
						return;
					}
				}}>
				<Image 
				blurRadius={blur}
				source={{
					uri: images[count].url,
					width: 200,
					height: 200
				}}/>
				</TouchableOpacity>
				<Text style={textStyle(mycolor)}>{verify}</Text>
			</View>
		</TouchableWithoutFeedback>
	)
}

export default App;